import { states } from './components/States.js';
import { StateMachine } from './components/StateMachine.js';

const styles = {
  card: {
    minWidth: 275,
  },
  title: {
    fontSize: 30,
  },
  pos: {
    marginBottom: 12,
  },
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <div>
          <h2>Carpool</h2>

          {this._currentStep()}
        </div>
      </div>
    );
  }
}

export default App;
